window.bookSummaryJSON = "<p>A love out of time. A spaceship built of secrets and murder....</p> <p>Seventeen-year-old Amy joins her parents as frozen cargo aboard the vast spaceship <i>Godspeed</i> and expects to awaken on a new planet, 300 years in the future. Never could she have known that her frozen slumber would come to an end 50 years too soon and that she would be thrust into the brave new world of a spaceship that lives by its own rules.</p> <p>Amy quickly realizes that her awakening was no mere computer malfunction. Someone - one of the few thousand inhabitants of the spaceship - tried to kill her. And if Amy doesn't do something soon, her parents will be next.</p> <p>Now Amy must race to unlock <i>Godspeed</i>'s hidden secrets. But out of her list of murder suspects, there's only one who matters: Elder, the future leader of the ship and the love she could never have seen coming.</p>"; 
